import React, { useState, useEffect } from "react";
import ReactMapGl from "react-map-gl";
const access_token =
  "pk.eyJ1Ijoic2F1bGlrIiwiYSI6ImNrcWM4NXJoYzAwdzkybm56djVka2VzZW0ifQ.QmYDZh6DNEwu5ITY9lQ6Ag";

function Map(props) {
  const [viewport, setViewport] = useState({
    latitude: 62,
    longitude: 25,
    zoom: 5,
  });

  const [maakunnat, setMaakunnat] = useState([...props.maakunnat]);
  const [tyypit, setTyypit] = useState([props.tyypit]);

  useEffect(() => {
    console.log("Props:", props);
    console.log("Maakunnat:", maakunnat);
    console.log("Tyypit:", tyypit);
  }, []);

  return (
    <ReactMapGl
      className="map"
      {...viewport}
      mapboxApiAccessToken={access_token}
      mapStyle="mapbox://styles/mapbox/streets-v11"
      height={800}
      width={600}
      onViewportChange={(viewport) => {
        setViewport(viewport);
      }}
    ></ReactMapGl>
  );
}

export default Map;
